window.bookSummaryJSON = "<p>Little girls are vanishing from Deadwood, South Dakota. Fearing her daughter might be next, single mom Violet Parker is desperate to find the monster behind the abductions. </p> <p>With her savings dwindling and just three weeks left to sell her first house or lose her realtor job, Violet is ecstatic when a handsome jeweler hires her to sell his century-old Victorian masterpiece - until she sees the dilapidated dwelling. Now if she could just convince her only buyer to stop rejecting vintage homes as if they're haunted. </p> <p>Short on time and long on worry, Violet refuses to give up her dream of a fresh start in Deadwood. But with a malicious coworker trying to get her fired, a secret admirer sending her creepy messages, and a sexy stranger hiding skeletons in his closet, will Violet end up as one of Deadwood's dearly departed?</p>"; 
